import './ForTest.css';

import { Container } from "react-bootstrap";

function ForTest(){
    return(
        <Container fluid>
            <Container>
                <div className="block">
                    <img src = "https://images.pexels.com/photos/15838281/pexels-photo-15838281.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" className = "imageForTest w-100"/>

                    <div className = "title">
                        <h1>Lorem ipsum dolor</h1>
                    </div>
                </div>
            </Container>
        </Container>
    )
}

export default ForTest
